INSERT INTO `known_knowledge` VALUES ('165064a6f6c543b9b858dc0091d0e38d', '13', '14', 'Java多线程实现的四种方式', '&lt;p&gt;1.继承Thread类，重写run方法&lt;/p&gt;&lt;p&gt;2.实现Runnable接口，重写run方法，实现Runnable接口的实现类的实例对象作为Thread构造函数的target&lt;/p&gt;&lt;p&gt;3.通过Callable和FutureTask创建线程&lt;/p&gt;&lt;p&gt;4.通过线程池创建线程&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;总结：&lt;br/&gt;&lt;/p&gt;&lt;p&gt;前面两种可以归结为一类：无返回值，原因很简单，通过重写run方法，run方式的返回值是void，所以没有办法返回结果&amp;nbsp;&lt;/p&gt;&lt;p&gt;后面两种可以归结成一类：有返回值，通过Callable接口，就要实现call方法，这个方法的返回值是Object，所以返回的结果可以放在Object对象中&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '1.继承Thread类，重写run方法2.实现Runnable接口，重写run方法，实现Runnable接口的实现类的实例对象作为Thread构造函数的target3.通过Callable和FutureTask创建线程4.通过线程池创建线程总结：前面两种可以归结为一类：无返回值，原因很简单，通过重写run方法，run方式的返回值是void，所以没有办法返回结果后面两种可以归结成一类：有返回值，通过......', '10086', '/resources/images/default_usericon/5.jpg', 'will', '2019-06-02 16:24:26', '1', '65', '1', '1', '', '', 1);
